Ce jeu de données est une des sources de datavisualisations disponibles sur le site [Data professionnels de santé libéraux](https://data.ameli.fr/pages/data-professionnels-sante-liberaux/).

### Mises à jour des données :

  * Mise à jour du 19/06/2023 : première mise en ligne des données, de l'année 2010 à l'année 2021
  * Mise à jour du 23/01/2024 : ajout des données de l'année 2022
  * Mise à jour du 04/11/2024 : ajout des données de l'année 2023
  * Mise à jour du 06/10/2025 : ajout des données de l'année 2024



Pour plus d'informations et détails sur les mises à jour et changements opérés dans les données (périmètre, mode de calcul, correctif, etc.), consulter la page [Méthode](https://data.ameli.fr/pages/data-professionnels-sante-liberaux-methode/) de ce site.

### Informations générales :

Les professions de santé libérales disponibles dans ce jeu de données sont : les **médecins** (avec plus d’une vingtaine de spécialités médicales).

Il s'agit de professionnels de santé actifs au 31 décembre de l’année concernée et :

  * exerçant leur activité en libéral ;
  * en France métropolitaine, Guadeloupe, Guyane, La Réunion, Martinique et Mayotte ;
  * ayant perçu au moins 1 euro d’honoraires ;
  * qu’ils soient conventionnés avec l’Assurance Maladie ou non conventionnés (lorsqu’ils génèrent une prescription remboursée par l’Assurance Maladie) ;
  * les professionnels en cumul emploi-retraite sont décomptés dans les effectifs dès lors qu’ils remplissent les conditions précédentes.



Ce jeu de données présente des informations sur le secteur conventionnel des médecins libéraux :

  * conventionnés en secteur 1 ;
  * conventionnés en secteur 2 ;
    * avec adhésion à l’Optam/Optam-CO ;
    * sans adhésion à l’Optam/Optam-CO ;
  * non conventionnés.



Plusieurs niveaux territoriaux sont disponibles : niveau national (France entière), région, département.

Les données sont issues du système national des données de santé (SNDS). Pour plus d'informations (source, champ, définitions des modalités), consulter la page [Méthode](https://data.ameli.fr/pages/data-professionnels-sante-liberaux-methode/) de ce site.

### Fréquence de mise à jour des données :

Les données proposées en téléchargement dans l’onglet « Export » sont mises à jour chaque année (données de la France entière depuis 2010).

