Ce jeu de données présente des informations sur les montants des différents postes de prescription des médecins libéraux :

  * médicaments ;
  * dispositifs médicaux inscrits à la liste des produits et prestations (LPP) (dont lits médicaux, fauteuils roulants, fourniture d'oxygène, prothèses diverses, matériel pour le traitement du diabète, aides auditives et visuelles, etc.) ;
  * biologie (actes de prélèvement et analyses biologiques) ;
  * soins infirmiers ;
  * kinésithérapie ;
  * transports des malades ;
  * indemnités journalières ;
  * autres (dont actes de pédicurie, d'orthophonie, d'orthoptie, de vaccination, cures thermales, frais de déplacement des professionnels, etc.).



Ces montants sont présentés :

  * en montant total (pour l’ensemble d'une profession) ;
  * en montant moyen (par professionnel).



